import React, { useState } from 'react';

function App() {
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [city, setCity] = useState('');
  const [nflWeight, setNFL] = useState('');
  const [nbaWeight, setNBA] = useState('');
  const [nhlWeight, setNHL] = useState('');
  const [games, setGames] = useState([]);
  const [weightGame, setWeightGame] = useState([]);
  const [error, setError] = useState(null);

  const date_city = async (event) => {
    event.preventDefault();

    // Construct the data payload
    let payload = {};
    if (startDate) payload.start_date = startDate;
    if (endDate) payload.end_date = endDate;
    if (city) payload.city = city;

    try {
      const response = await fetch('http://localhost:5000/date-city', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(payload),
      });

      if (!response.ok) {
        throw new Error('Failed to fetch games data');
      }

      const data = await response.json();
      setGames(data); // Set the games state with the received data
      setError(null); // Clear any existing error messages
    } catch (error) {
      setError('Error fetching data. Please try again.');
      setGames([]); // Clear the games data on error
    }
  };

  const weighted_date = async (event) => {
    event.preventDefault();

    // Construct the data payload
    const payload = {
      nfl_weight: nflWeight,
      nba_weight: nbaWeight,
      nhl_weight: nhlWeight,
      start_date: startDate,
      end_date: endDate,
    };

    try {
      const response = await fetch('http://localhost:5000/weighted-date', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(payload),
      });

      if (!response.ok) {
        throw new Error('Failed to fetch games data');
      }

      const data = await response.json();
      setWeightGame(data); // Set the games state with the received data
      setError(null); // Clear any existing error messages
    } catch (error) {
      setError('Error fetching weighted data. Please try again.');
      setWeightGame([]); // Clear the games data on error
    }
  };

  return (
    <div className="App">
      <h1>Game Schedule Finder</h1>
      <form onSubmit={date_city}>
        <div>
          <label>Start Date:</label>
          <input
            type="date"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
          />
        </div>
        <div>
          <label>End Date:</label>
          <input
            type="date"
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
          />
        </div>
        <div>
          <label>City:</label>
          <input
            type="text"
            value={city}
            onChange={(e) => setCity(e.target.value)}
          />
        </div>
        <button type="submit">Submit</button>
      </form>
      <form onSubmit={weighted_date}>
        <div>
          <label>NFL Weight:</label>
          <input
            type="text"
            value={nflWeight}
            onChange={(e) => setNFL(e.target.value)}
            required
          />
        </div>
        <div>
          <label>NBA Weight:</label>
          <input
            type="text"
            value={nbaWeight}
            onChange={(e) => setNBA(e.target.value)}
            required
          />
        </div>
        <div>
          <label>NHL Weight:</label>
          <input
            type="text"
            value={nhlWeight}
            onChange={(e) => setNHL(e.target.value)}
            required
          />
        </div>
        <button type="submit">Submit Weighted Request</button>
      </form>

      {/* Error message display */}
      {error && <p style={{ color: 'red' }}>{error}</p>}

      {/* Display the JSON data */}
      {games.length > 0 && (
        <div>
          <h2>Game Schedule</h2>
          <ul>
            {games.map((game, index) => (
              <li key={index}>
                <strong>{game[1]}</strong> - {game[4]} vs {game[5]}<br />
                Date: {game[2]}, Time: {game[3]}<br />
                Venue: {game[6]}, City: {game[7]}
              </li>
            ))}
          </ul>
        </div>
      )}
      {/* Display the JSON data */}
      {weightGame.length > 0 && (
        <div>
          <h2>Weighted Game Schedule</h2>
          <ul>
            {weightGame.map((game, index) => (
              <li key={index}>
                <strong>{game[1]} - {game[0]}</strong> Points: {game[2]}<br />
                <ul>
                  {game[3].split('\n').map((line, lineIndex) => (
                    <li key={lineIndex}>
                      {line}
                    </li>
                  ))}
                </ul>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default App;
